from models.data_models import TowerReport


WINDOW_ICON_BASE64 = """

"""

class ProcessingThread(QThread):
    progress = pyqtSignal(str)
    finished = pyqtSignal(dict)
    error = pyqtSignal(str)

    def __init__(self, zip_path: str, output_path: str):
        super().__init__()
        self.zip_path = zip_path
        self.output_path = output_path
        self.template_path = "./template.xlsx"

    def run(self):
        try:
            if not Path(self.template_path).exists():
                raise FileNotFoundError(f"Template not found: {self.template_path}")

            self.progress.emit("Loading data from ZIP...")
            df = DataLoader.load_from_zip(self.zip_path)

            self.progress.emit("Cleaning numeric columns...")
            numeric_cols = [
                ColumnIndex.SN_ADDITION_NUM, ColumnIndex.SN_ADDITION_DEN,
                ColumnIndex.ABNORMAL_SN_RELEASE_NUM, ColumnIndex.ABNORMAL_SN_RELEASE_DEN,
                ColumnIndex.DL_UE_THROUGHPUT_NUM, ColumnIndex.DL_UE_THROUGHPUT_DEN,
                ColumnIndex.UL_UE_THROUGHPUT_NUM, ColumnIndex.UL_UE_THROUGHPUT_DEN,
                ColumnIndex.DL_SE_MAPPING_NUM, ColumnIndex.DL_SE_MAPPING_DEN
            ]
            df_clean = DataCleaner.clean_dataframe(df, numeric_cols)

            self.progress.emit("Parsing TOWERID & dates...")
            df_parsed = DataParser.add_parsed_columns(df_clean)

            self.progress.emit("Calculating KPIs...")
            grouped = df_parsed.groupby(['TOWERID', 'DATE'])
            reports = []

            for (tower_id, dt), group in grouped:
                kpi_values = KPICalculator.calculate_kpis(group)
                kpi_status, overall = Evaluator.evaluate_all(kpi_values)
                reports.append(TowerReport(tower_id, dt, kpi_values, kpi_status, overall))

            self.progress.emit("Generating report...")
            TemplateGenerator.create_detailed_report(reports, self.template_path, self.output_path)

            pass_count = sum(1 for r in reports if r.overall_status == "PASS")
            fail_count = sum(1 for r in reports if r.overall_status == "FAIL")
            unique_dates = len(set(r.report_date for r in reports))

            self.finished.emit({
                'total': len(reports),
                'pass': pass_count,
                'fail': fail_count,
                'dates': unique_dates,
                'output': self.output_path
            })

        except Exception as e:
            self.error.emit(f"Error: {str(e)}\n\n{traceback.format_exc()}")


class MainWindow(QMainWindow):
    def __init__(self):
        super().__init__()
        self.zip_path = None
        self.processing_thread = None
        self.is_processing = False
        self.init_ui()
        self.setup_dark_theme()
        self.set_window_icon()

    def set_window_icon(self):
        """Set application icon from base64 string"""
        if not WINDOW_ICON_BASE64.strip():
            return

        try:
            icon_bytes = base64.b64decode(WINDOW_ICON_BASE64.strip())
            pixmap = QPixmap()
            if not pixmap.loadFromData(icon_bytes):
                raise ValueError("Failed to load pixmap from data")
            self.setWindowIcon(QIcon(pixmap))
            
        except Exception as e:
            print(f"Warning: Could not load application icon: {e}")

    def init_ui(self):
        self.setWindowTitle("5G Stability Report")
        self.setGeometry(100, 100, 580, 420)
        self.setMinimumSize(520, 360)

        central = QWidget()
        self.setCentralWidget(central)
        layout = QVBoxLayout(central)
        layout.setSpacing(10)
        layout.setContentsMargins(12, 12, 12, 12)

        # Small buttons row
        btn_layout = QVBoxLayout()
        btn_layout.setSpacing(8)

        self.browse_btn = QPushButton("Select ZIP")
        self.style_small_button(self.browse_btn, "#424242", "#616161")
        self.browse_btn.clicked.connect(self.browse_file)

        self.start_btn = QPushButton("START")
        self.style_small_button(self.start_btn, "#1e88e5", "#1565c0")
        self.start_btn.setEnabled(False)
        self.start_btn.clicked.connect(self.start_processing)

        btn_layout.addWidget(self.browse_btn)
        btn_layout.addWidget(self.start_btn)

        layout.addLayout(btn_layout)

        # Loading indicator (simple rotating text dots)
        self.loading_label = QPushButton("      ")
        self.loading_label.setEnabled(False)
        self.style_small_button(self.loading_label, "#424242", "#424242", text_color="#888")
        self.loading_label.setMaximumWidth(80)
        self.loading_label.hide()
        layout.addWidget(self.loading_label, alignment=Qt.AlignmentFlag.AlignCenter)

        # Log area
        self.log_area = QTextEdit()
        self.log_area.setReadOnly(True)
        self.log_area.setFont(QFont("Consolas", 9))
        self.log_area.setStyleSheet("""
            QTextEdit {
                background-color: #1e1e1e;
                color: #e0e0e0;
                border: 1px solid #333;
                border-radius: 4px;
                padding: 8px;
            }
        """)
        layout.addWidget(self.log_area)

    def style_small_button(self, btn: QPushButton, bg: str, hover: str, text_color="#e0e0e0"):
        btn.setFont(QFont("Segoe UI", 9))
        btn.setMinimumHeight(28)
        btn.setMaximumHeight(32)
        btn.setStyleSheet(f"""
            QPushButton {{
                background-color: {bg};
                color: {text_color};
                border: none;
                border-radius: 4px;
                padding: 4px 12px;
            }}
            QPushButton:hover {{
                background-color: {hover};
            }}
            QPushButton:pressed {{
                background-color: {hover};
                color: #ffffff;
            }}
            QPushButton:disabled {{
                background-color: #333;
                color: #666;
            }}
        """)

    def setup_dark_theme(self):
        palette = QPalette()
        palette.setColor(QPalette.ColorRole.Window, QColor(30, 30, 30))
        palette.setColor(QPalette.ColorRole.WindowText, QColor(224, 224, 224))
        palette.setColor(QPalette.ColorRole.Base, QColor(18, 18, 18))
        palette.setColor(QPalette.ColorRole.AlternateBase, QColor(35, 35, 35))
        palette.setColor(QPalette.ColorRole.Text, QColor(224, 224, 224))
        palette.setColor(QPalette.ColorRole.Button, QColor(45, 45, 45))
        palette.setColor(QPalette.ColorRole.ButtonText, QColor(224, 224, 224))
        self.setPalette(palette)

    def browse_file(self):
        file_path, _ = QFileDialog.getOpenFileName(
            self, "Select ZIP", "", "ZIP Files (*.zip)"
        )
        if file_path:
            self.zip_path = file_path
            self.log(f" {Path(file_path).name}")
            self.start_btn.setEnabled(True)

    def start_processing(self):
        if not self.zip_path:
            return

        current_time = datetime.now().strftime("%Y%m%d_%H%M%S")
        default_name = f"5G_Stability_Report_{current_time}.xlsx"

        output_path, _ = QFileDialog.getSaveFileName(
            self, "Save Report", default_name, "Excel Files (*.xlsx)"
        )
        if not output_path:
            return
        if not output_path.lower().endswith('.xlsx'):
            output_path += '.xlsx'

        self.browse_btn.setEnabled(False)
        self.start_btn.setEnabled(False)
        self.start_btn.setText("PROCESSING...")
        self.log_area.clear()
        self.log(""*48)
        self.log(" Starting processing...")

        # Simple loading animation (dots)
        self.loading_label.show()
        self.dots_animation = QTimer(self)
        self.dots_animation.timeout.connect(self.update_loading_dots)
        self.dot_count = 0
        self.dots_animation.start(500)

        self.processing_thread = ProcessingThread(self.zip_path, output_path)
        self.processing_thread.progress.connect(self.log)
        self.processing_thread.finished.connect(self.on_finished)
        self.processing_thread.error.connect(self.on_error)
        self.processing_thread.start()

    def update_loading_dots(self):
        self.dot_count = (self.dot_count + 1) % 4
        dots = " " * self.dot_count
        self.loading_label.setText(f"  {dots.ljust(6)}  ")

    def log(self, message: str):
        self.log_area.append(message)
        self.log_area.ensureCursorVisible()

    def on_finished(self, results: dict):
        self._finish_cleanup()

        self.log(""*48)
        self.log(" FINISHED")
        self.log(f"  Total:   {results['total']:,}")
        self.log(f"  PASS:    {results['pass']:,}")
        self.log(f"  FAIL:    {results['fail']:,}")
        self.log(f"  Dates:   {results['dates']}")
        self.log(f"\nSaved  {results['output']}")

        QMessageBox.information(
            self, "Done",
            f"Report generated successfully!\n\n{results['output']}"
        )

    def on_error(self, error_msg: str):
        self._finish_cleanup()
        self.log(""*48)
        self.log("!!! ERROR !!!")
        self.log(error_msg)

        QMessageBox.critical(self, "Error", error_msg)

    def _finish_cleanup(self):
        self.dots_animation.stop()
        self.loading_label.hide()
        self.browse_btn.setEnabled(True)
        self.start_btn.setEnabled(True)
        self.start_btn.setText("START")


